import React, { useState, useEffect } from 'react';
import { NavBar } from './components/Scaffold';

function App() {
	let [backendData, setData] = useState();
	let [isLoading, setLoad] = useState(true);

	useEffect(() => {
		setLoad(true);
		fetch('/api')
			.then((response) => response.json())
			.then((data) => {
				console.log(data.name);
				setData(data);
				setLoad(false);
			});
	}, []);

	let load = () => {
		if (isLoading) {
			return 'Is Loading';
		} else {
			return backendData.age;
		}
	};

	return <div>{load()}</div>;
}

export default App;
